import React from "react";
import "./_nav.scss";
import "../_generales.scss";
import Cart from "./Cart";
import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <nav>
      <div className="lista">
        <NavLink to="/" a>
          Inicio{" "}
        </NavLink>
        <NavLink to="/Usuarios" a>
          Usuarios
        </NavLink>
        <NavLink to="/ItemListContainer" a>
          Lolcito
        </NavLink>
      </div>
      <Cart />
    </nav>
  );
};

export default NavBar;
